INSERT INTO `models` VALUES (1,3,'Error Evaluation Test','','','#include \"indri/TermScoreFunction.hpp\"\r\n#include <iostream>\r\n\r\nusing namespace std;\r\n\r\nindri::query::TermScoreFunction::TermScoreFunction( double collectionOccurence, double collectionSize, double documentOccurrences, double documentCount, double queryLength, std::map<std::string, double>& paras ) {\r\n\r\n}\r\n\r\n\r\ndouble indri::query::TermScoreFunction::scoreOccurrence( double occurrences, int contextSize, double qtf, double docUniqueTerms ) {\r\n  std::cout << \"asdf\" << endl;\r\n  return qtf;\r\n}','2016-03-03 02:50:48','2016-04-19 18:51:42','2016-04-19 18:52:10',0,''),(3,3,'Term Frequency','','this is the formal test','#include \"indri/TermScoreFunction.hpp\"\r\n#include <cmath>\r\n\r\nindri::query::TermScoreFunction::TermScoreFunction( double collectionOccurence, double collectionSize, double documentOccurrences, double documentCount, double queryLength, std::map<std::string, double>& paras ) {\r\n  _collectionOccurence = collectionOccurence;\r\n  _collectionSize = collectionSize;\r\n  _documentOccurrences = documentOccurrences;\r\n  _documentCount = documentCount;\r\n}\r\n\r\n\r\ndouble indri::query::TermScoreFunction::scoreOccurrence( double occurrences, int contextSize, double qtf, double docUniqueTerms ) {\r\n  return qtf * occurrences;\r\n}','2016-03-03 18:58:01','2016-04-19 18:49:49','2016-04-19 18:51:05',0,''),(6,5,'Dirichlet Language Model','mu=2500','C. Zhai and J. Lafferty. A study of smoothing methods for language models applied to information retrieval. ACM Trans. Inf. Syst., 22(2):179214, Apr. 2004.','#include \"indri/TermScoreFunction.hpp\"\r\n#include <cmath>\r\n\r\nindri::query::TermScoreFunction::TermScoreFunction( double collectionOccurence, double collectionSize, double documentOccurrences, double documentCount, double queryLength, std::map<std::string, double>& paras ) {\r\n  _collectionOccurence = collectionOccurence;\r\n  _collectionSize = collectionSize;\r\n  _documentOccurrences = documentOccurrences;\r\n  _documentCount = documentCount;\r\n  _modelParas = paras;\r\n  _modelParas[\"mu\"] = 2500;\r\n  _modelParas[\"collectionFrequency\"] = _collectionOccurence ? (_collectionOccurence/_collectionSize) : (1.0 / _collectionSize*2.);\r\n  _modelParas[\"_muTimesCollectionFrequency\"] = _modelParas[\"mu\"] * _modelParas[\"collectionFrequency\"];\r\n  //_preCompute();\r\n}\r\n\r\n\r\ndouble indri::query::TermScoreFunction::scoreOccurrence( double occurrences, int contextSize, double qtf, double docUniqueTerms ) {\r\n  double seen = ( double(occurrences) + _modelParas[\"_muTimesCollectionFrequency\"] ) / ( double(contextSize) + _modelParas[\"mu\"] );\r\n  return qtf * log( seen );\r\n}','2016-04-16 21:33:13','2016-07-18 13:44:45','2016-07-18 13:45:13',0,''),(7,3,'Error Model','','This is for compile error test','asdf','2016-04-19 21:31:48','2016-04-19 21:31:48','2016-04-19 21:32:03',1,'../src/TermScoreFunction.cpp:1:1: error: \'asdf\' does not name a type\n asdf\n ^\nmake[1]: *** [TermScoreFunction.o] Error 1\nmake: *** [all] Error 2\n\n'),(8,5,'BM25','b=0.25','S. Robertson, S. Walker, S. Jones, M. Hancock-Beaulieu, and M. Gatford. Okapi at trec-3. pages 109126, 1996.','#include \"indri/TermScoreFunction.hpp\"\r\n#include <cmath>\r\n\r\nvoid indri::query::TermScoreFunction::_preCompute() {\r\n  _modelParas[\"b\"] = 0.25;\r\n  _modelParas[\"k1\"] = 1.2;\r\n  _modelParas[\"k3\"] = 1000;\r\n  _modelParas[\"idf\"] = log( ( _documentCount - _documentOccurrences + 0.5 ) / ( _documentOccurrences + 0.5 ) );\r\n  _modelParas[\"avgDocLength\"] = _collectionSize / double(_documentCount);\r\n  _modelParas[\"_idfTimesK1PlusOne\"] = _modelParas[\"idf\"] * ( _modelParas[\"k1\"] + 1 );\r\n  _modelParas[\"_k1TimesOneMinusB\"] = _modelParas[\"k1\"] * (1-_modelParas[\"b\"]);\r\n  _modelParas[\"_bOverAvgDocLength\"] = _modelParas[\"b\"] / _modelParas[\"avgDocLength\"];\r\n  _modelParas[\"_k1TimesBOverAvgDocLength\"] = _modelParas[\"k1\"] * _modelParas[\"_bOverAvgDocLength\"];\r\n}\r\n\r\nindri::query::TermScoreFunction::TermScoreFunction( double collectionOccurence, double collectionSize, double documentOccurrences, double documentCount, double queryLength, std::map<std::string, double>& paras ) {\r\n  _collectionOccurence = collectionOccurence;\r\n  _collectionSize = collectionSize;\r\n  _documentOccurrences = documentOccurrences;\r\n  _documentCount = documentCount;\r\n  _modelParas = paras;\r\n  _preCompute();\r\n}\r\n\r\n\r\ndouble indri::query::TermScoreFunction::scoreOccurrence( double occurrences, int contextSize, double qtf, double docUniqueTerms ) {\r\n    double norm_qtf = (_modelParas[\"k3\"] + 1) * qtf / (_modelParas[\"k3\"] + qtf);\r\n    double numerator = norm_qtf * occurrences * _modelParas[\"_idfTimesK1PlusOne\"];\r\n    double denominator = occurrences + _modelParas[\"_k1TimesOneMinusB\"] + _modelParas[\"_k1TimesBOverAvgDocLength\"] * contextSize;\r\n    return numerator / denominator;\r\n}','2016-06-06 14:03:12','2016-07-18 13:45:54','2016-07-18 13:46:07',0,''),(9,5,'Pivoted Document Length Normalization','s=0.05','A. Singhal, C. Buckley, and M. Mitra. Pivoted document length normalization. In Proceedings of the 19th Annual International ACM SIGIR Conference on Research and Development in Information Retrieval, SIGIR 96, pages 2129, New York, NY, USA, 1996. ACM.','#include \"indri/TermScoreFunction.hpp\"\r\n#include <cmath>\r\n\r\n\r\nvoid indri::query::TermScoreFunction::_preCompute() {\r\n  _modelParas[\"s\"] = 0.05;\r\n  _modelParas[\"idf\"] = log( ( _documentCount + 1 ) / ( _documentOccurrences + 0.5 ) );\r\n  _modelParas[\"avgDocLength\"] = _collectionSize / double(_documentCount);\r\n}\r\n\r\nindri::query::TermScoreFunction::TermScoreFunction( double collectionOccurence, double collectionSize, double documentOccurrences, double documentCount, double queryLength, std::map<std::string, double>& paras ) {\r\n  _collectionOccurence = collectionOccurence;\r\n  _collectionSize = collectionSize;\r\n  _documentOccurrences = documentOccurrences;\r\n  _documentCount = documentCount;\r\n  _modelParas = paras;\r\n  _preCompute();\r\n}\r\n\r\n\r\ndouble indri::query::TermScoreFunction::scoreOccurrence( double occurrences, int contextSize, double qtf, double docUniqueTerms ) {\r\n  if (occurrences - 0.0 < 1e-6) return 0;\r\n  double score = _modelParas[\"idf\"] * ( 1+log(1+log(occurrences)) ) / ( 1-_modelParas[\"s\"]+_modelParas[\"s\"]*contextSize/_modelParas[\"avgDocLength\"] );\r\n  return qtf * score;\r\n}','2016-07-18 01:53:47','2016-07-18 02:33:04','2016-07-18 02:34:06',0,''),(10,5,'F2EXP','s=0.05, k=0.35','H. Fang and C. Zhai. An exploration of axiomatic approaches to information retrieval. In Proceedings of the 28th Annual International ACM SIGIR Conference on Research and Development in Information Retrieval, SIGIR 05, pages 480487, New York, NY, USA, 2005. ACM.','#include \"indri/TermScoreFunction.hpp\"\r\n#include <cmath>\r\n\r\n\r\nvoid indri::query::TermScoreFunction::_preCompute() {\r\n  _modelParas[\"s\"] = 0.05;\r\n  _modelParas[\"idf\"] = pow( ( _documentCount + 1 ) / ( _documentOccurrences + 0.5 ), 0.35 );\r\n  _modelParas[\"avgDocLength\"] = _collectionSize / double(_documentCount);\r\n}\r\n\r\nindri::query::TermScoreFunction::TermScoreFunction( double collectionOccurence, double collectionSize, double documentOccurrences, double documentCount, double queryLength, std::map<std::string, double>& paras ) {\r\n  _collectionOccurence = collectionOccurence;\r\n  _collectionSize = collectionSize;\r\n  _documentOccurrences = documentOccurrences;\r\n  _documentCount = documentCount;\r\n  _modelParas = paras;\r\n  _preCompute();\r\n}\r\n\r\n\r\ndouble indri::query::TermScoreFunction::scoreOccurrence( double occurrences, int contextSize, double qtf, double docUniqueTerms ) {\r\n  if (occurrences - 0.0 < 1e-6) return 0;\r\n  double score = _modelParas[\"idf\"] * occurrences / ( occurrences+_modelParas[\"s\"]+_modelParas[\"s\"]*contextSize/_modelParas[\"avgDocLength\"] );\r\n  return qtf * score;\r\n}','2016-07-18 02:46:56','2016-07-18 03:06:29','2016-07-18 03:07:06',0,''),(11,5,'F2LOG','s=0.05, k=0.35','H. Fang and C. Zhai. An exploration of axiomatic approaches to information retrieval. In Proceedings of the 28th Annual International ACM SIGIR Conference on Research and Development in Information Retrieval, SIGIR 05, pages 480487, New York, NY, USA, 2005. ACM.','#include \"indri/TermScoreFunction.hpp\"\r\n#include <cmath>\r\n\r\n\r\nvoid indri::query::TermScoreFunction::_preCompute() {\r\n  _modelParas[\"s\"] = 0.05;\r\n  _modelParas[\"idf\"] = log( ( _documentCount + 1 ) / ( _documentOccurrences + 0.5 ) );\r\n  _modelParas[\"avgDocLength\"] = _collectionSize / double(_documentCount);\r\n}\r\n\r\nindri::query::TermScoreFunction::TermScoreFunction( double collectionOccurence, double collectionSize, double documentOccurrences, double documentCount, double queryLength, std::map<std::string, double>& paras ) {\r\n  _collectionOccurence = collectionOccurence;\r\n  _collectionSize = collectionSize;\r\n  _documentOccurrences = documentOccurrences;\r\n  _documentCount = documentCount;\r\n  _modelParas = paras;\r\n  _preCompute();\r\n}\r\n\r\n\r\ndouble indri::query::TermScoreFunction::scoreOccurrence( double occurrences, int contextSize, double qtf, double docUniqueTerms ) {\r\n  if (occurrences - 0.0 < 1e-6) return 0;\r\n  double score = _modelParas[\"idf\"] * occurrences / ( occurrences+_modelParas[\"s\"]+_modelParas[\"s\"]*contextSize/_modelParas[\"avgDocLength\"] );\r\n  return qtf * score;\r\n}','2016-07-18 13:55:31','2016-07-18 13:55:31','2016-07-18 13:56:06',0,''),(12,5,'BM3','mu=2500','B. He and I. Ounis. A study of the dirichlet priors for term frequency normalisation. In Proceedings of the 28th Annual International ACM SIGIR Conference on Research and Development in Information Retrieval, SIGIR 05, pages 465471, New York, NY, USA, 2005. ACM.','#include \"indri/TermScoreFunction.hpp\"\r\n#include <cmath>\r\n\r